import { Routes, Route, Link } from 'react-router-dom'
import Home from'./Home';
import Date from'./Date';
import News from'./News';
import Login from'./Login';
import Topic from'./Topic';
import Editor from'./Editor';
import UserConf from'./User/UserConf';
import { useState } from 'react';
import Signup from './Signup';

function Navbar() { 
  const [token, setToken] = useState(null)
  //const [id, setId] = useState(null)

 return(
 <div>
 <nav>
   <Link className="link" to="/">Inicio</Link>
   <Link className="link" to="/news">News</Link>
   <Link className="link" to="/date">Date</Link>
   <Link className="link" to="/topic">Topic</Link>
   { token ? <Link className="link" to="/editor">Editor</Link>
   : <></>  }
   <span>
   { token ? <Link className="link" to="/user">Profile</Link>
   : <Link className="link" to="/login">Login</Link> }
   </span>
   </nav>
 <Routes>
   <Route path="/" exact element={<Home/>} />
   <Route path="/news" element={<News />} />
   <Route path="/date" element={<Date />} />
   <Route path="/topic" element={<Topic />} />
   <Route path="/editor" element={<Editor token= {token}/>} />
   <Route path="/user" element={<UserConf token= {token} user={user}  />} />
   <Route path="/login" element={<Login setToken = {setToken}/>} />
   <Route path="/signup" element={<Signup />} />
 </Routes>
</div>
    
)}

export default Navbar;
